package com.example.uploaddownloadapi1.controller;import com.example.uploaddownloadapi1.service.FileStorageService;import jakarta.annotation.Resource;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.http.ResponseEntity;import org.springframework.web.bind.annotation.*;import org.springframework.web.multipart.MultipartFile;import java.io.IOException;import java.util.logging.Level;import java.util.logging.Logger;@RestControllerpublic class FileManagerController {    @Autowired    private FileStorageService fileStorageService;    private static final Logger log = Logger.getLogger(FileManagerController.class.getName());    @PostMapping("/upload-file")    public boolean upload (@RequestParam("file")MultipartFile file) {        try {            fileStorageService.saveFile(file);            return true;        }catch (IOException e) {            log.log(Level.SEVERE, "Exception during upload", e);        }        return false;    }    @GetMapping("/download-file")    public ResponseEntity<Resource> downloadFile (@RequestParam("file")String filename) {    }}